import React,{createContext,} from 'react';
import './App.css';
import Header from './Header';
import LabTabs from './LabTabs';
import Footer from './Footer';

const FirstName = createContext();

function App() {
  return (
    <>
      <FirstName.Provider value={'vinod'}>
      <Header/> 
      <LabTabs/>
      <Footer/>
      </FirstName.Provider>
    </>
  );
}

export default App;
